import "./App.css";
import {BrowserRouter, Route, Switch} from "react-router-dom";
import Home from "./Home";
import Learn from "./Learn";

function App() {
  return (
    <div className="mx-auto my-auto w-3/4 h-3/4">
      <BrowserRouter basename="/">
        <Switch>
          <Route exact path="/">
            <Home></Home>
          </Route>
          <Route exact path="/learn">
            <Learn></Learn>
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
